import CourseForm from "./components/CourseForm";
import CourseList from "./components/CourseList";

function App() {
  return (
    <div className="App">
      <h1>Timetable Manager</h1>
      <CourseForm onAdd={() => window.location.reload()} />
      <CourseList />
    </div>
  );
}

export default App;
